import React, { Component } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export class Home extends Component {
  render() {
    return (
      <main className='home'>
        <h2 className='home__greet'>Greetings!</h2>
        <Link to='/slider'></Link>
      </main>
    )
  }
}

export default Home
